import React, { Component } from 'react';
import '../App.css';
import Header from './Header';
import DragAndDropFunction from './DragAndDrop';
import 'bootstrap/dist/css/bootstrap.css';
import { MdFileUpload } from 'react-icons/md';


const spacing = {
  paddingTop: '100px',
}

const spacingtitle = {
  paddingBottom: '10px',
  color: 'white',
}

export default class Work extends Component {

  render() {
    return (
      <div className="App">
          <Header></Header>

          <div className="container" style={spacing}>
            <div className="row justify-content-centera">
              <div className="col-md-4"><MdFileUpload/><p style={spacingtitle}>Uploader votre fichier</p>
                <DragAndDropFunction></DragAndDropFunction>
              </div>

              <div className="col-md-4"><p style={spacingtitle}>En attente de traitement ...</p>
                <DragAndDropFunction></DragAndDropFunction>
              </div>

              <div className="col-md-4"><p style={spacingtitle}>En cours de traitement ...</p>
                <DragAndDropFunction></DragAndDropFunction>
              </div>
            </div>
          </div>

      </div>
    )
  }

}
